 package org.esblink.common.base.cache;
 
 public class CacheEntry
 {
   Object data;
   Object key;
 
   public Object getData()
   {
     return this.data;
   }
 
   public Object getKey()
   {
     return this.key;
   }
 
   public void setData(Object data)
   {
     this.data = data;
   }
 
   public void setKey(Object key)
   {
     this.key = key;
   }
 }


 
 
